## Birth of the Undead

[https://www.deviantart.com/sheikkinen/art/Birth-of-the-Undead-1002741665](https://www.deviantart.com/sheikkinen/art/Birth-of-the-Undead-1002741665)



### Description

Throughout history, childbirth has been fraught with risk, with high
maternal mortality rates due to a lack of hygienic practices, medical
knowledge, and adequate nutrition. In pre-modern societies, the process
was overseen by midwives with varying expertise, and superstition often
took precedence over scientific understanding. The 19th century
introduced obstetrics but also saw the spread of puerperal fever,
especially in hospitals. Major improvements came in the 20th century
with the advent of antiseptic techniques, antibiotics, and better
prenatal care, significantly reducing the risks of childbirth. However,
disparities in maternal health persist, particularly in under-resourced
areas, emphasizing the ongoing need for global attention to maternal
care.\
\
